import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';

function Perfil() {
  const user = JSON.parse(localStorage.getItem('user'));
  const { email } = user;
  return (
    <div>
      <Header titulo="Perfil" showProfileIcon />
      <p></p>
      <Footer />
    </div>
  );
}

export default Perfil;
